import React from "react";
import styled from "styled-components";

const Container = styled.div`
  height: auto;
  width: 80%;
  padding: 4rem 0rem 0rem 4rem;
`;

const Span = styled.span`
  color: blue;
`;

const ModalTypr = () => {
  return (
    <Container>
      <Container1>
        <Span>hello</Span>
      </Container1>
      <Container2 />
    </Container>
  );
};

export default TyprModal;
